Cast
Tony Fernanda Lemos

Sun April 18, 2010

JB once again provides me with a phenomenal example of Brazilian beauty for you. Fernandia was a firecracker. She has that wild streak that makes any man immediately realize he is in for a great time. She is the type that is the life of the party, always making people laugh and feel at ease. JB almost could not deal with her ability to make him feel amazing. This update was almost only two minutes long. LOL. Thankfully he was able to hold out and give us all a great treat.
